My Pregnancy is a week-by-week pregnancy tracker. Our app will help you over the course of your pregnancy. Stay on top of the changes happening inside your body. Find out how your baby is developing.

Our app is completely free and does not contain advertising.

This app includes:
- week-by-week advice;
- useful information on fetal development and changes in your body;
- week-by-week fetal measurements and imaging;
- a to-do list for each trimester;
- a list of things you will need for hospital check-in, post-natal care and check-out;
- a weight tracker you can use to follow weight gain;
- a kick counter;
- a contraction timer;
- and much more

We have created this app with love, specially for young mothers.

This app is not intended for medical use and is not a substitute for medical consultation.

If you have any questions or requests, please write to neumandev@gmail.com. We are eager to hear your comments on how to improve the app.

The main goal of our program is to give everyone a chance to have clear vision. Uniquely designed plan of short trainings. Download the app and start improving your eyesight right now!

WELL-ROUNDED EYESIGHT RECOVERY PROGRAM
- designed according to your goals;
- includes groups of specific exercises sets and recommendations to people suffering from different types of defective vision;
- advice and recommendations about exercises performing;
- you can adjust the training plan yourself;

SIMPLE AND SHORT VIDEO LESSONS
- great variety of exercises.

MOTIVATION
- “smart” notifications to inform you about upcoming trainings;
- tips and other users feedback.


INFORMATION ABOUT USING THE APP, SUBSCRIPTION TERMS AND DETAILS
Downloading and using the “Gymnastics to restore sight” app is free of charge. Premium account provides new exercises and complete training days, gives a user an opportunity to adjust the notification settings and remove the ads. In order to get the Premium the payment will be performed via the iTunes account. Monthly subscription is $9,99, annual subscription is $29,99 (the cost may differ depending on the country). The subscription will be automatically prolonged for the next period if the user doesn’t refuse the subscription 24 hours before the end of the current subscription. The current subscription cancelling is impossible. Automatic prolongation can be switched off in the iTunes account settings after subscription purchasing. You can control the subscription in your iTunes account settings.

